import React, { Component } from 'react'

export default class BannerItem extends Component {
    render() {
        let { item } = this.props
        return (
            <li>
                <a href="https://www.facebook.com/">
                    {" "}
                    <i class="fa fa-plus" aria-hidden="true"></i>
                    {item.tenDanhMuc}
                </a>
            </li>
        )
    }
}
